import React from "react";
import { Carousel } from "react-responsive-carousel";
import meuble1 from "../../assets/Images/meuble1.png";
import meuble2 from "../../assets/Images/meuble2.png";
import meuble3 from "../../assets/Images/meuble3.png";
import meuble4 from "../../assets/Images/meuble4.png";
import {
  Item,
  ImgItem,
  ContentItem,
  PItem,
  ButtonItem,
} from "./HeroSlidesElements.js";
import "react-responsive-carousel/lib/styles/carousel.min.css";
import "./style.css";

export const HeroSlides = () => {
  return (
    <div className="HeroSlides">
      <Carousel
        autoPlay={true}
        centerMode={true}
        showStatus={false}
        showArrows={false}
        swipeable={false}
      >
        <Item>
          ContentItem
          <ImgItem src={meuble1} />
          <p>Hello</p>
        </Item>
        <Item>
          <ImgItem src={meuble2} />
        </Item>
        <Item>
          <ImgItem src={meuble3} />
        </Item>
        <Item>
          <ImgItem src={meuble4} />
        </Item>
      </Carousel>
    </div>
  );
};

export default HeroSlides;
